<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="utf-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
  <meta name="viewport" content="width=device-width,initial-scale=1.0">
  <link rel="shortcut icon" type="image/x-icon" href="<%= BASE_URL %>favicon.ico">
  <title><%= htmlWebpackPlugin.options.title %></title>
  <% if (process.env.NODE_ENV === 'production') { %>
  <script>
    document.write('<script src="<%= BASE_URL %>config.js?t=' + new Date().getTime() + '"><\/script>');
  </script>
  <% }else { %>
  <script src="<%= BASE_URL %>config/index.js"></script>
  <script src="<%= BASE_URL %>config/init.js"></script>
  <% } %>
  <% if (process.env.npm_config_production) { %>
  <script src="//cdn.bootcdn.net/ajax/libs/vue/2.6.11/vue.min.js"></script>
  <% }else { %>
  <script src="//cdn.bootcdn.net/ajax/libs/vue/2.6.11/vue.js"></script>
  <% } %>
  <script src="//cdn.bootcdn.net/ajax/libs/vuex/3.2.0/vuex.min.js"></script>
  <script src="//cdn.bootcdn.net/ajax/libs/vue-router/3.2.0/vue-router.min.js"></script>
  <script src="//cdn.bootcdn.net/ajax/libs/axios/0.19.2/axios.min.js"></script>
  <script src="//cdn.bootcdn.net/ajax/libs/element-ui/2.13.2/index.js"></script>
</head>

<body>
  <noscript>
    <strong>We're sorry but vue-router-tab doesn't work properly without JavaScript enabled. Please enable it to
      continue.</strong>
  </noscript>
  <div id="app"></div>
  <!-- built files will be auto injected -->
</body>
<script type="text/javascript" src="//js.users.51.la/20233665.js"></script>
</html>
